Accept or reject redirection response. Application MUST call this function after it signaled PJSIP_REDIRECT_PENDING in the \a onCallRedirected() callback, to notify the call whether to accept or reject the redirection to the current target. Application can use the combination of PJSIP_REDIRECT_PENDING command in \a onCallRedirected() callback and this function to ask for user permission before redirecting the call.
Note that if the application chooses to reject or stop redirection (by using PJSIP_REDIRECT_REJECT or PJSIP_REDIRECT_STOP respectively), the call disconnection callback will be called before this function returns. And if the application rejects the target, the \a onCallRedirected() callback may also be called before this function returns if there is another target to try.
